import math

def prime_numbers(lower_limit, upper_limit):
    primes = []
    for num in range(lower_limit, upper_limit - 1):
        if num <= 1:
            continue
        if num <= 3:
            primes.append(num)
            continue
        if num % 2 == 0 or num % 3 == 0:
            continue
        for i in range(5, int(math.sqrt(num)) + 1, 6):
            if num % i == 0 or num % (i + 2) == 0:
                break
        else:
            primes.append(num)
    return primes

